import React from "react";
import ReactDOM from "react-dom";
import Heading from "./heading";
import Note from "./Note";
import Footer from "./Footer"
import Allnotes from "../Allnotes"

function createNote(prop)
{
  return (
    <Note
   title={prop.title}
   content={prop.content}
    />

  );
}

function App()
{
  return (<div><Heading />
    Allnotes.map(createNote);

     <Note
     title={Allnotes[1].title}
     content={Allnotes[1].content}
      />
      <Note
      title={Allnotes[2].title}
      content={Allnotes[2].content}
       />
    <Footer />
    </div>);

}
export default App;
